import React from 'react';

function About() {
    return (
        <section>
            <h2 id="about" className="flex-row">About Me</h2>
            <div className="flex-row">
                {/* <img src={solopic} alt="selfie" /> */}
            </div>
            <div className="flex-row">
                <p>Hello I am a full stack developer based in Houston, Texas. I took the coding bootcamp offered in UT of Austin. I am growing as I learn and hope to meet others that think the same.
                </p>
            </div>
        </section>
    );
}

export default About;
